import React from 'react'
import { useHistory } from 'react-router-dom'
import foodImages from './FoodImages'
export default function MainPage() {
  return (
    <div>
       {foodImages.map((image, index) => (
        <img
          key={index}
          src={image.src}
          alt={`Food ${index + 1}`}
          onClick={() => {
            history.push(image.path)
          }}
        />
      ))}



    </div>

  )
}
